import React, { useContext } from "react";
import { contextData } from "./Context";
import { Link } from "react-router-dom";

export const LabelToppost = () => {
  const [data] = useContext(contextData);
  let count = 0;
  return (
    <div className="toppost">
      <h1>Top Post</h1>
      {data
        .filter((x) => x.id >= 19 && x.id < 23)
        .map((e) => {
          {
            if (e.id == 19) {
              return (
                <Link to={`/${e.category}/${e.id}`} className="link2">
                  <div className="toppost1">
                    <img src={e.image} />
                    <h5>{e.title.slice(0, 32)}</h5>
                    <span>{`${(count = count + 1)}`}</span>
                    {/* <p>{e.content.slice(0, 120)}</p> */}
                    <p>
                      <b>{e.category}</b> / {e.date}
                    </p>
                  </div><hr className="hrstl4" />
                </Link>
              );
            } else {
              return (
                <Link to={`/${e.category}/${e.id}`} className="link2">
                  <div className="toppost2">
                    <img src={e.image} />
                    <h5>{e.title.slice(0, 32)}</h5>
                    <span>{`${(count = count + 1)}`}</span>
                    <p>{e.content.slice(0, 120)}</p>
                    <p>
                      <b>{e.category}</b> / {e.date}
                    </p>
                  </div>
                  <hr className="hrstl4" />
                </Link>
              );
            }
          }
        })}
    </div>
  );
};
